/* eslint-disable jsx-a11y/anchor-is-valid */
import { useState } from "react";

function FunctionB() {
	const [userInp,setUserInp]=useState();
	return (
		<div className="col-5">
			<input 
				type="text"
				value={userInp}
				onChange={(e) =>setUserInp(e.target.value)}
			/>
			<ul>
				<li><a href="" className="text-dark text">Rohit sharma</a></li>
				<li><a href="" className="text-dark text">Shubman Gill</a></li>
				<li><a href="" className="text-dark text">Virat Kohli</a></li>
				<li><a href="" className="text-dark text">Shreyas Iyer</a></li>
				<li><a href="" className="text-dark text">Ishan Kishan</a></li>
				<li><a href="" className="text-dark text">Kl Rahul</a></li>
				<li><a href="" className="text-dark text">Ravindra Jadeja</a></li>
				<li><a href="" className="text-dark text">Hardik Pandya</a></li>
				<li><a href="" className="text-dark text">Axar Patel</a></li>
				<li><a href="" className="text-dark text">Kuldeep Yadav</a></li>
				<li><a href="" className="text-dark text">Jasprit Bumrah</a></li>
				<li><a href="" className="text-dark text">Mohmmad Shami</a></li>
				<li><a href="" className="text-dark text">Mohmmad Siraj</a></li>
			</ul>
		</div>
	)
}

export default FunctionB
